import s from './Friends.module.css';
import { NavLink } from 'react-router-dom';


const Friends = (props) => {
	return (
		<div className={s.friends}>
			<h3 className={s.friends__title}>Friends</h3>
			<div className={s.friends__items}>
				<Friend />
			</div>
		</div>

	)
}

export default Friends;
